        return (
            <div>
                <header className="App-header">
                    <h1>Sorting App</h1>
                    <p style={{ fontFamily: "times new roman" }}> helps u sort ur number ! </p>
                </header>
                <div>
                    <InsertNumber />
                </div>

            </div>

        );
    }
}

export default Home;
